public static final class MatchText extends org.jsoup.select.Evaluator {
    @java.lang.Override
    public boolean matches(org.jsoup.nodes.Element root, org.jsoup.nodes.Element element) {
        if (element instanceof org.jsoup.nodes.PseudoTextElement) {
            return true;
        }
        java.util.List<org.jsoup.nodes.TextNode> textNodes = element.textNodes();
        for (org.jsoup.nodes.TextNode textNode : textNodes) {
            org.jsoup.nodes.PseudoTextElement pel = new org.jsoup.nodes.PseudoTextElement(org.jsoup.parser.Tag.valueOf(element.tagName()), element.baseUri(), element.attributes());
            textNode.replaceWith(pel);
            pel.appendChild(textNode);
        }
        return false;
    }

    @java.lang.Override
    public java.lang.String toString() {
        return ":matchText";
    }
}

